import React, {Component} from 'react';
import logo from './dbs-logo.png';
import './App.css';

class App extends Component {
    render() {
        return (
            <div
                className="App"
                style={{}}
            >
                <div className="App-header">
                    <img src={logo} className="App-logo" alt="logo"/>
                    <div
                        style={{
                            borderRadius: 24,
                            backgroundColor: "#ffaaaa",
                            margin: 24,
                        }}
                    >
                        <input
                            placeholder={"What would you like to do today? "}
                            style={{
                                fontSize: 24,
                                margin: 5,
                                borderColor: '#ffffff',
                                flexDirection: 'row',
                                minWidth: 500,
                                height: 32,
                                padding: 5,
                                border: 0,
                                backgroundColor: '#00000000'
                            }}
                        />
                    </div>
                </div>

                <div>
                    <p
                        style={{
                            textAlign: 'left',
                        }}
                    >
                        Quick Links
                    </p>
                </div>
            </div>
        );
    }
}

export default App;
